import React, { Component } from 'react'

export default class InputEmail extends Component {
  render() {
    const { value, handleChange } = this.props;
    return (
      <label>
        <input
          value={value}
          onChange={handleChange}
          name="inputEmail"
          placeholder="input email"
          type="email" />
      </label>
    )
  }
}
